import React from 'react'

export function Header() {
  return (
    <>
    <div id="nav-logo">
        <a href="https://www.amazon.in/ref=nav_logo " id="nav-logo-sprites" class="nav-logo-link nav-progressive-attribute" aria-label="Amazon.in">
      <span class="nav-sprite nav-logo-base"></span>
      
    </a>
    </div>
    </>
  )
}
